import React from 'react';
import useWindowSize from './WindowSize.js'
import Confetti from 'react-confetti';

const Success = () => {
    const { width, height } = useWindowSize()

    return (
        <div>
            <Confetti
                width={width}
                height={height}
                colors={['rbg(255,255,77']}
                style={{ position: 'fixed' }}
            />
        </div>
    )
}

